package com.higgs.trust.consensus.p2pvalid.dao.po;import java.util.Date;public class QueuedApplyDelayPO extends BaseEntity<QueuedApplyDelayPO> {    private static final long serialVersionUID = 1L;    private Long id;    private String messageDigest;    private Long applyTime;    private Date createTime;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public String getMessageDigest() {        return this.messageDigest;    }    public void setMessageDigest(String messageDigest) {        this.messageDigest = messageDigest;    }    public Long getApplyTime() {        return this.applyTime;    }    public void setApplyTime(Long applyTime) {        this.applyTime = applyTime;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    @Override    public String toString() {        StringBuilder builder = new StringBuilder();        builder.append("QueuedApplyDelayPO [");           builder.append("id=");        builder.append(id);        builder.append(", messageDigest=");        builder.append(messageDigest);        builder.append(", applyTime=");        builder.append(applyTime);        builder.append(", createTime=");        builder.append(createTime);        builder.append("]");        return builder.toString();    }}